% Compute the cal coefs for a fenwal 192 circuit%  Given vt = adc voltage in volts.% where R = 4990 ohms, V = 5.00 volts% Rt = R * (V - 2*vt) / vt%clearR = 4990;  V = 5;vt = [.2:.01:2]';Rt = R * (V-2*vt) ./ vt;t = fenwal192(Rt);T = t + 273.15;xT = 1 ./ T;lnr = log(1 ./ Rt);p = polyfit(lnr, xT, 3);xxT = polyval(p,lnr);txx = 1 ./ xxT - 273.15;tx = 48.33 * vt - 37.67;%plot(t,tx-t,'b',t,txx-t,'r'), grid%plot(t,txx-t,'r'), gridplot(t,txx), gridfigure(gcf);format long e, p', format short g